import React from "react";

const SearchBar = (props) => {
  const handleSearchChange = (event) => {
    props.setQuery(event.target.value);
  };


  
  return (
    <div>
      <form>
        <input
          id="searchbar"
          type="text"
          placeholder="Search.."
          onChange={handleSearchChange}
        ></input>
      </form>
    </div>
  );
};

export default SearchBar;
